// Function to show information based on phase clicked
function showPhase(phase) {
    const phaseInfo = document.getElementById('phase-info');
    
    const infoContent = {
      phase1: {
        title: "Phase 1: Early Stage",
        content: "Phase 1 refers to the initial outbreak of COVID-19. During this phase, cases are limited, and governments take actions like quarantines, travel bans, and awareness programs to contain the virus.",
        image: "data:image/png;base64," // Phase 1 image
      },
      phase2: {
        title: "Phase 2: Widespread Spread",
        content: "Phase 2 is when the virus spreads to multiple regions, leading to high infection rates. Health systems are overwhelmed, and measures such as lockdowns and mass testing are implemented to slow the spread.",
        image: "data:image/png;base64," // Phase 2 image
      }
    };
  
    // Display corresponding information based on the phase clicked
    if (phaseInfo) {
      phaseInfo.style.display = 'block'; // Show the info box
      phaseInfo.innerHTML = `
        <h2>${infoContent[phase].title}</h2>
        <p>${infoContent[phase].content}</p>
        <img src="${infoContent[phase].image}" alt="${infoContent[phase].title}">
      `;
    }
  }
  